 sum(total_sale.'current_sales') as 'current_sales', sum(total_qty.'current_quantity') as 'current_quantity', avg(total_comp.'current_comp') as 'current_comp', avg(total_oos.'current_oos') as 'current_oos', avg(total_fcs.'current_fcs') as 'current_fcs', avg(total_sos.'current_sos') as 'current_sos', avg(total_promo.'current_promo') as 'current_promo', avg(total_inventory.'current_inventory') as 'current_inventory', 
 
 sum(total_sale.'previous_sales') as 'previous_sales', sum(total_qty.'previous_quantity') as 'previous_quantity', avg(total_comp.'previous_comp') as 'previous_comp', avg(total_oos.'previous_oos') as 'previous_oos', avg(total_fcs.'previous_fcs') as 'previous_fcs', avg(total_sos.'previous_sos') as 'previous_sos', avg(total_promo.'previous_promo') as 'previous_promo', avg(total_inventory.'previous_inventory') as 'previous_inventory';
