 sum('previous_sales') as 'previous_sales', sum('previous_quantity') as 'previous_quantity', avg('previous_comp') as 'previous_comp', avg('previous_oos') as 'previous_oos', avg('previous_fcs') as 'previous_fcs', avg('previous_sos') as 'previous_sos', avg('previous_promo') as 'previous_promo', avg('previous_inventory') as 'previous_inventory';
